    private static string[] OutputAll(GameGraphNode StartingNode)
    {
        HashSet<Fen> Processed = new(); //to avoid infinite loops
        List<string> Output = new List<string>();
        void OutputALlInner(GameGraphNode Node)
        {
            if(Processed.Contains(Node.PositionAfterMove)){ return; }
            Processed.Add(Node.PositionAfterMove);
            // foreach(Move Move in Node.Moves)
            // {
            //     builder.Append(Move.AlgebraticMove);
            // }
            Output.Add(Node.PositionAfterMove.FenString);
            foreach(GameGraphNode child in Node.Children)
            {
                OutputALlInner(child);
            }
        }
        OutputALlInner(StartingNode);
        return Output.ToArray();
    }
